import React from 'react'
import c from './ModelItem.module.css'
export const ModelItem = (props) => {
  return (
    <div className={c.modelItem}>
        {/* <img className={c.image}src="" alt="" /> */}
        <div className={c.image}>ds</div>
        <div className={c.description}>
            <div className={c.name}>
                {props.name}
            </div>
            <div className={c.title}>
                {props.title}
            </div>
            <div className={c.id}>
                Код товару:{props.id}
        </div>
        </div>
        {props.sale?<div className={c.cost}>
            <div className={c.sale}>{props.cost}₴</div>
            {props.sale}₴
        </div>:<div className={c.cost}>
            {props.cost}₴
        </div>}
        
    </div>
  )
}
